// SPDX-License-Identifier: MIT

pragma solidity 0.6.12;

import "../openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "../openzeppelin/contracts/math/SafeMath.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "../interface/IFund.sol";
import "../interface/IRisk.sol";
import "../interface/ITrade.sol";
import "../interface/IMine.sol";
import "../interface/IPool.sol";

contract TeemoPool is ERC20("TMOLP", "TMOLP"), IPool, Ownable {
    address public tokenAddr;
    address public quoteFactoryAddr;
    address public fundAddr;
    address public riskAddr;
    address public tradeAddr;
    address public mineAddr;

    event OpenSwap(bytes32 indexed orderID, uint256 indexed openPrice);
    event CloseSwap(
        uint256 indexed closePrice,
        uint256 indexed plFlag,
        uint256 indexed plAmount
    );

    function initialize(address _tokenAddr, address _quoteFactoryAddr)
        public
        onlyOwner
    {
        tokenAddr = _tokenAddr;
        quoteFactoryAddr = _quoteFactoryAddr;
    }

    function orderLength() public override view returns (uint256) {
        return ITrade(tradeAddr).orderLength();
    }

    function getAllOrderId() public override view returns (bytes32[] memory) {
        return ITrade(tradeAddr).getAllOrderId();
    }

    function getTokenAddr() public override view returns (address) {
        return tokenAddr;
    }

    function setFundAddr(address _fundAddr) public override onlyOwner {
        fundAddr = _fundAddr;
    }

    function setRiskAddr(address _riskAddr) public override onlyOwner {
        riskAddr = _riskAddr;
    }

    function setTradeAddr(address _tradeAddr) public override onlyOwner {
        tradeAddr = _tradeAddr;
    }

    function setMineAddr(address _mineAddr) public override onlyOwner {
        mineAddr = _mineAddr;
    }

    // LP充值
    function deposit(address _userAddr, uint256 _tokenAmount)
        public
        override
        returns (
            uint256 teemoTokenAmount,
            uint256 userTeemoTokenAmount,
            uint256 lpAmount
        )
    {
        IERC20(tokenAddr).transferFrom(_userAddr, address(this), _tokenAmount);
        lpAmount = IFund(fundAddr).deposit(_userAddr, _tokenAmount);
        //_mint(address(this),lpAmount);// 增发lptoken
        //授权挖矿的合约
        //approve(mineAddr,lpAmount);
        //帮用户自动充值lptoken参与挖矿TMO
        (teemoTokenAmount, userTeemoTokenAmount) = IMine(mineAddr).deposit(
            _userAddr,
            lpAmount
        );
    }

    // LP提现
    function withdraw(address _userAddr, uint256 _lpAmount)
        public
        override
        returns (
            uint256 teemoTokenAmount,
            uint256 userTeemoTokenAmount,
            uint256 tokenAmount
        )
    {
        tokenAmount = IFund(fundAddr).withdraw(_userAddr, _lpAmount);
        (teemoTokenAmount, userTeemoTokenAmount) = IMine(mineAddr).withdraw(
            _userAddr,
            _lpAmount
        ); //帮用户自动提取lptoken退出挖矿TMO,lptoken先打到合约上
        //_burn(address(this),_lpAmount);// 销毁lptoken
        IERC20(tokenAddr).transfer(_userAddr, tokenAmount); // 转账提取的token
    }

    // 永续合约建仓
    function openSwap(
        string memory _symbol,
        uint256 _tokenAmount,
        uint256 _lever,
        uint256 _bsFlag
    ) public {
        IERC20(tokenAddr).transferFrom(msg.sender, address(this), _tokenAmount);
        (bytes32 orderID, uint256 openPrice) = ITrade(tradeAddr).openSwap(
            msg.sender,
            _symbol,
            _tokenAmount,
            _lever,
            _bsFlag
        );
        emit OpenSwap(orderID, openPrice);
    }

    // 永续合约平仓
    function closeSwap(string memory _symbol, bytes32 _orderID) public {
        (
            uint256 closePrice,
            uint256 plFlag,
            uint256 plAmount,
            uint256 tradeAmount
        ) = ITrade(tradeAddr).closeSwap(msg.sender, _symbol, _orderID);
        IFund(fundAddr).tradePL(msg.sender, tradeAmount, plFlag, plAmount);
        if (plFlag == 1) {
            // 交易用户盈利了
            IERC20(tokenAddr).transfer(msg.sender, tradeAmount.add(plAmount));
        } else {
            IERC20(tokenAddr).transfer(msg.sender, tradeAmount.sub(plAmount));
        }
        emit CloseSwap(closePrice, plFlag, plAmount);
    }
}
